import { Button,Container,Nav,Navbar,NavDropdown,Carousel } from 'react-bootstrap';
import './App.css';



import 'bootstrap/dist/css/bootstrap.min.css';


import MyNav from './MyNav';


// Partnerships
import Partnership_xyz_Hunt1 from "./PartnershipExample/PartnershipHunt1";
import Partnership_xyz_Nav from './PartnershipExample/PartnershipNav';
import Partner_xyz_Home from "./PartnershipExample/PartnerHome";



import SingleCard from './components/Structure/Game1/SingleCard';
import moment from 'moment';

// import img1 from './Treasure-hunt.jpeg';

import React, { Component, useState, useEffect } from 'react'
import {BrowserRouter as Router,Switch,Route,Link,Redirect} from "react-router-dom";


import getWeb3 from "./getWeb3";
import Connection from "./Connection";

import { useWallet, UseWalletProvider } from 'use-wallet'


import { Helmet } from 'react-helmet';

import axios from 'axios';



// Partnerships

// THAAS HUNT Example

// "/Partnership_xyx_1"
// "/Partnership_xyx_Home"
// "/PartnershipLevel1"
// "/PartnershipLevel1More"
// "/PartnershipLevel2"
// "/PartnershipLevel2More"
// "/PartnershipLevel3"
// "/PartnershipLevel4"

import PartnershipLevel1 from "./PartnershipExample/MiniGamesSelector/Game1";
import PartnershipLevel1More from "./PartnershipExample/MiniGamesSelector/Game1MoreGame1";


import PartnershipLevel2 from "./PartnershipExample/MiniGamesSelector/Game2";
import PartnershipLevel2More from "./PartnershipExample/MiniGamesSelector/Game2MoreGame1";

import PartnershipLevel3 from "./PartnershipExample/MiniGamesSelector/Game3";
import PartnershipLevel4 from "./PartnershipExample/MiniGamesSelector/Game4";



// Handle Partner Landing PAGE

var partner_xyz_LandingPageHome = false;

if (window.location.href.includes("_xyz_Home")){
  var partner_xyz_LandingPageHome = true;
}

if (window.location.href.includes("_xyz_Hunt1")){
  var partner_xyz_LandingPageHome = true;
}


const AppPartnership_xyx_ = (props) => {


  const partnership_home_xyz_ = "/PartnershipHome";
  const partnership_treasure_hunt_page_xyz_ = "/Partnership1";
  const partnership_1_xyz_ = "/PartnershipLevel1";
  const partnership_1_more_xyz_ = "/PartnershipLevel1More";
  const partnership_2_xyz_ = "/PartnershipLevel2";
  const partnership_2_more_xyz_ = "/PartnershipLevel2More";
  const partnership_3_xyz_ = "/PartnershipLevel3";
  const partnership_4_xyz_ = "/PartnershipLevel4";


  const [web3_xyz_,setWeb3_xyz_] = useState(null)
  const [accounts_xyz_,setAccounts_xyz_] = useState(null)

  const [wallet_for_google_xyz_, setWallet_for_google_xyz_] = useState('Unknown');

  console.log(wallet_for_google_xyz_,"string?")
  const [ip_xyz_, setIP_xyz_] = useState('');

  const [contract_xyz,setContract_xyz_] = useState(null)
  const [tokenContract_xyz_,setTokenContract_xyz_] = useState(null)
  const [decimals_xyz_,setDecimals_xyz_] = useState(null)
  const [totalTreasure_xyz_,setTotalTreasure_xyz_] = useState(null)
  const [gameContractAddress_xyz_,setGameContractAddress_xyz_] = useState(null)




  // GAME _xyz_
    const [_xyz_id,set_xyz_id] = useState(undefined)
    const [_xyz_live,set_xyz_live] = useState(undefined)
    const [_xyz_prize,set_xyz_prize] = useState(undefined)
    const [_xyz_question_hash,set_xyz_question_hash] = useState(undefined)
    const [_xyz_time_lock_cost,set_xyz_time_lock_cost] = useState(undefined)
    const [_xyz_submit_secret_cost,set_xyz_submit_secret_cost] = useState(undefined)
    const [_xyz_riddle,set_xyz_riddle] = useState(undefined)
    const [_xyz_clue,set_xyz_clue] = useState(undefined)
    const [_xyz_head_start_time,set_xyz_head_start_time] = useState(undefined)
    const [_xyz_entry_limit,set_xyz_entry_limit] = useState(undefined)
    const [_xyz_entry_cost,set_xyz_entry_cost] = useState(undefined)

    const [all_xyz_id,setall_xyz_id] = useState(undefined)
    const [all_xyz_user_front_of_que,setall_xyz_user_front_of_que] = useState(undefined)
    const [all_xyz_deadline_time,setall_xyz_deadline] = useState(undefined)
    const [all_xyz_username,setall_xyz_username] = useState(undefined)
    const [all_xyz_total_game_tries,setall_xyz_total_game_tries] = useState(undefined)

    const [count_xyz_, setTime_xyz_] = useState(90);
    const [count_xyz_DeadlineTrue, setcount_xyz_DeadlineTrue] = useState(false);

    const [_xyz_numberOfEntries, set_xyz_numberOfEntries] = useState(0);
    const [_xyz_huntEntries, set_xyz_huntEntries] = useState(undefined);
    const [user_xyz_id, setUser_xyz_id] = useState(undefined);
    const [userEntered_xyz_, setUserEntered_xyz_] = useState(undefined);
    const [user_xyz_headstart_time, setUser_xyz_headstart_time] = useState(undefined);
    const [user_xyz_live, setUser_xyz_live] = useState(undefined);

    const [winning_address_xyz_, setWinning_address_xyz_] = useState(undefined);
    const [treasure_found_xyz_, setTreasure_found_xyz_] = useState(undefined);
    const [winning_prize_xyz_, setWinning_prize_xyz_] = useState(undefined);
    const [question_hash_solved_xyz_, setQuestion_hash_solved_xyz_] = useState(undefined);
    const [winning_message_xyz_, setWinning_message_xyz_] = useState(undefined);

    const [attemptId_xyz_, setAttemptId_xyz_] = useState(undefined);
    const [attemptAddress_xyz_, setAttemptAddress_xyz_] = useState(undefined);
    const [attemptUsername_xyz_, setAttemptUsername_xyz_] = useState(undefined);
    const [attemptDeadline_xyz_, setAttemptDeadline_xyz_] = useState(undefined);
    const [totalGameEntries_xyz_, settotalGameEntries_xyz_] = useState(false);

  // Leaderboard
    const [_xyz_LeaderBoardIndex, set_xyz_LeaderBoardIndex] = useState(["Loading"]);
    const [_xyz_LeaderBoardGameID, set_xyz_LeaderBoardGameID] = useState(["Loading"]);
    const [_xyz_LeaderBoardAddress, set_xyz_LeaderBoardAddress] = useState(["Loading"]);
    const [_xyz_LeaderBoardEntered, set_xyz_LeaderBoardEntered] = useState(["Loading"]);
    const [_xyz_LeaderBoardUsername, set_xyz_LeaderBoardUsername] = useState(["Loading"]);
    const [_xyz_LeaderBoardTries, set_xyz_LeaderBoardTries] = useState(["Loading"]);
    const [_xyz_LeaderBoardStage, set_xyz_LeaderBoardStage] = useState(["Loading"]);


    const [_xyz_LeaderBoard, set_xyz_LeaderBoard] = useState(["Loading"]);
    const [_xyz_UserList, set_xyz_UserList] = useState(["Loading"]);

    // Leaderbaord Address Search
    const [state_leaderboardAddressSearch_huntid_xyz_, setleaderboardAddressSearch_huntid_xyz_] = useState(false);
    const [state_leaderboardAddressSearch_address_xyz_, setleaderboardAddressSearch_address_xyz_] = useState(false);
    const [state_leaderboardAddressSearch_entered_xyz_, setleaderboardAddressSearch_entered_xyz_] = useState(false);
    const [state_leaderboardAddressSearch_username_xyz_, setleaderboardAddressSearch_username_xyz_] = useState(false);
    const [state_leaderboardAddressSearch_tries_xyz_, setleaderboardAddressSearch_tries_xyz_] = useState(false);
    const [state_leaderboardAddressSearch_stage_xyz_, setleaderboardAddressSearch_stage_xyz_] = useState(false);
    const [state_WinnerEstPrize_xyz_,setWinnerEstPrize_xyz_] = useState(false);

  // User Levels

    const [userLevel_xyz_xyz_,setUserLevel_xyz_xyz_] = useState(false);
    const [userLevel2_xyz_,setUserLevel2_xyz_] = useState(false);
    const [userLevel3_xyz_,setUserLevel3_xyz_] = useState(false);
    const [userLevel4_xyz_,setUserLevel4_xyz_] = useState(false);



  useEffect(() => {


      const init = async() => {
        //creating function to load ip address from the API

        // const res = await axios.get('https://geolocation-db.com/json/')
        // console.log(res,"herererererere");
        // setIP(res.data.IPv4)

        // console.log(localStorage,"item local")
        // {"country_code":"IT","country_name":"Italy","city":null,"postal":null,"latitude":43.1479,"longitude":12.1097,"IPv4":"149.71.134.27","state":null}

        const web3_xyz_ = await getWeb3();

        const accounts_xyz_ = await web3_xyz_.eth.getAccounts();

        const abi_xyz_ = require('./TreasureBlox.abi.json');
        const abiToken_xyz_ = require('./TreasureBloxToken.abi.json');
        // Set the provider
        // web3.setProvider(new web3.providers.WebsocketProvider('ws://localhost:8545'));
        // this.web3.setProvider(new this.web3.providers.HttpProvider('https://data-seed-prebsc-1-s1.binance.org:8545/'));

        // LOCAL
        // const contract = new web3.eth.Contract(abi,"localhost:8545" && "0x9987602E9e9A76CbA7e9DB9217A0962BA8F9e605");
        // MainNet
        // const contract = new web3.eth.Contract(abi,"https://bsc-dataseed.binance.org/" && "0x845f23Ae63b5d03a363f216Ce0BAD4FB12259930");

// Proxy 0x359a72d9F33685c025A6435fE1Cb4dF8fF6736B6
// GameV2 0xE2f3578757fe29a481D0221A6d1Ce7A33Ae01170

        const contract_xyz_ = new web3_xyz_.eth.Contract(abi_xyz_,"https://bsc-dataseed.binance.org/" && "0x1e59C9EEE5AD272464335deDB5abC466ef9a6643");
        const gameAddress_xyz_ = "0x1e59C9EEE5AD272464335deDB5abC466ef9a6643"

        // const contract = new web3.eth.Contract(abi,"https://data-seed-prebsc-1-s1.binance.org:8545/" && "0xd34ac2bC3a7851d586EdDc3819a5c0Eea84563A3");
        // const gameAddress = "0xd34ac2bC3a7851d586EdDc3819a5c0Eea84563A3"

        setGameContractAddress_xyz_(gameAddress_xyz_);

        const tokenContract_xyz_ = new web3_xyz_.eth.Contract(abiToken_xyz_,"https://bsc-dataseed.binance.org/" && "0x845f23Ae63b5d03a363f216Ce0BAD4FB12259930");


        // const tokenContract = new web3.eth.Contract(abiToken,"https://data-seed-prebsc-1-s1.binance.org:8545/" && "0x4203b43Bb1c245529d5b6dA0F53fc263194D16ba");

        // TestNet
        // const contract = new web3.eth.Contract(abi,"https://data-seed-prebsc-1-s1.binance.org:8545/" && "0xE2f3578757fe29a481D0221A6d1Ce7A33Ae01170");
        // Sstart Data Calls
        const decimals = await tokenContract_xyz_.methods.decimals().call().then(console.log('Yes'));

        var totalTreasure_xyz_ = await tokenContract_xyz_.methods.balanceOf("0xbb4e46e5407d69b7a8e5948703C7bf3214f84295").call();
        totalTreasure_xyz_ = totalTreasure_xyz_.substring(0, tokenContract_xyz_.length-18)
        console.log(totalTreasure_xyz_,"Total Treasure token contract")

        // const owner = await contract.methods._owner().call();
        // const marketingWallet = await contract.methods.marketingWallet().call().then(console.log('marketing Wallet Complete'));
        //
        // const total_supply = await contract.methods.totalSupply().call();
        // const treasure_chest = await contract.methods.treasureChest().call();
        setWeb3_xyz_(web3_xyz_)
        setAccounts_xyz_(accounts_xyz_[0])
        setContract_xyz_(contract_xyz_)
        setDecimals_xyz_(decimals_xyz_)
